const title = `useModuleApps`;
const content = "\"---\\ntitle: useModuleApps\\n---\\n# useModuleApps\\n\\n返回所有微前端子应用的 React 组件，用于可自由控制路由。\\n\\n## 使用姿势\\n\\n```tsx\\nimport { useModuleApps } from '@modern-js/plugin-garfish/runtime';\\n```\\n\\n## 函数签名\\n\\n`function useModuleApps(): Record<string, React.FC<any>>`\\n\\n分别返回包裹每个子应用后的 React 组件。\\n\\n## 示例\\n\\n需要先配置微前端子应用信息。\\n\\nimport EnableMicroFrontend from \\\"@site-docs/components/enable-micro-frontend\\\";\\n\\n<EnableMicroFrontend />\\n\\n```tsx title=App.tsx\\nfunction App() {\\n  const { Home, Contact } = useModuleApps();\\n\\n  return (\\n    <div>\\n      Master APP\\n      <Route exact path=\\\"/home\\\">\\n        <Home />\\n      </Route>\\n      <Route exact path=\\\"/home\\\">\\n        <Contact />\\n      </Route>\\n    </div>\\n  );\\n}\\n\\ndefineConfig(App, {\\n  masterApp: {\\n    apps: [\\n      {\\n        // name 区分大小写，name 提供的是什么 useModuleApps 返回的就是什么\\n        name: 'Home',\\n        entry: 'http://127.0.0.1:8081/',\\n      },\\n      {\\n        name: 'Contact',\\n        entry: 'http://localhost:8082',\\n      },\\n    ],\\n  },\\n});\\n```\\n\\n通过 `useModuleApps()` 获取到 `Home` 和 `Contact` 子应用组件（名称和配置里的 `name` 字段对应），之后就可以像使用普通的 React 组件一样去加载子应用。\\n\\n### 集中式路由\\n\\n**集中式路由** 是将子应用的激活路由集中配置的方式。我们给子应用列表信息添加 `activeWhen` 字段来启用 **集中式路由**。\\n\\nimport MicroRuntimeConfig from \\\"@site-docs/components/micro-runtime-config\\\";\\n\\n<MicroRuntimeConfig />\\n\\n然后在主应用中使用 `useModuleApp` 方法获取 `MApp` 组件, 并在主应用渲染 `MApp`。\\n\\n```tsx title=主应用：App.tsx\\nimport { useModuleApp } from '@modern-js/plugin-runtime';\\n\\nfunction App() {\\n  const { MApp } = useModuleApps();\\n\\n  return (\\n    <div>\\n      <MApp />\\n    </div>\\n  );\\n}\\n\\ndefineConfig(App, {\\n  masterApp: {\\n    apps: [\\n      {\\n        // name 区分大小写，name 提供的是什么 useModuleApps 返回的就是什么\\n        name: 'Dashboard',\\n        activeWhen: '/dashboard',\\n        entry: 'http://127.0.0.1:8081/',\\n      },\\n      {\\n        name: 'TableList',\\n        activeWhen: '/table',\\n        entry: 'http://localhost:8082',\\n      },\\n    ],\\n  },\\n});\\n```\\n\\n这样启动应用后，访问 `/dashboard` 路由，会渲染 `Dashboard` 子应用，访问 `/table` 路由，会渲染 `TableList` 子应用。\\n\\n## 加载动画\\n\\n可以通过以下方式，自定义组件加载过程的过渡动画。\\n\\n```tsx title=App.tsx\\nfunction App() {\\n  const { Home } = useModuleApps();\\n\\n  return (\\n    <div>\\n      Master APP\\n      <Route exact path=\\\"/home\\\">\\n        <Home\\n          loadable={{\\n            loading: ({ pastDelay, error }: any) => {\\n              if (error) {\\n                console.error(error);\\n                return <div>error: {error?.message}</div>;\\n              } else if (pastDelay) {\\n                return <div>loading</div>;\\n              } else {\\n                return null;\\n              }\\n            },\\n          }}\\n        />\\n      </Route>\\n    </div>\\n  );\\n}\\n```\\n\"";
